INSERT INTO `ap_news_translations` (`id`, `language_code`, `slug`, `title`, `description`, `content`, `file_timeline`, `content_more`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(3, 'vi', '6-co-nang-kol-the-hien-tinh-than-tao-tao-cung-chien-dich-clash-de-cartier', '6 cô nàng KOL thể hiện tinh thần táo tạo cùng chiến dịch Clash De Cartier', '', '<div itemprop=\"description\" class=\"content-detail__short-desc\">\r\n<p>T&uacute; Hảo, Kh&aacute;nh Linh, Ph&iacute; Phương Anh, Quỳnh Anh Shyn, Hồ Thu Anh v&agrave; Chloe Nguyễn l&agrave; 6 c&ocirc; n&agrave;ng được Cartier gọi t&ecirc;n trong chiến dịch Clash De Cartier lần n&agrave;y. Mỗi c&ocirc; n&agrave;ng với một t&iacute;nh c&aacute;ch kh&aacute;c biệt nhưng vẫn to&aacute;t l&ecirc;n được tinh thần &ldquo;Clash&rdquo; đầy t&aacute;o bạo, đậm c&aacute; t&iacute;nh v&agrave; tr&agrave;n đầy tự chủ.</p>\r\n</div>\r\n<div itemprop=\"articleBody\" class=\"content-detail__content\">\r\n<p><img class=\"aligncenter size-full wp-image-400688\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/kol-chien-dich-clash-de-cartier.jpg\" alt=\"kol chiến dịch clash de cartier\" width=\"1200\" height=\"1000\"></p>\r\n<p>Kể từ khi được ra mắt, Clash De Cartier được mệnh danh l&agrave; &ldquo;Vi&ecirc;n Ngọc Qu&yacute; Hai Mặt&rdquo;, BST đ&atilde; mở ra một kỷ nguy&ecirc;n mới cho nh&agrave; kim ho&agrave;n với tinh thần &ldquo;Clash&rdquo; x&ocirc; ng&atilde; mọi giới hạn v&agrave; tho&aacute;t ra khỏi những quy tắc cứng nhắc. Bộ sưu tập đ&atilde; tạo n&ecirc;n cơn sốt trong giới mộ điệu.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400680\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/Clash-De-Cartier-Khanh-Linh-2.jpg\" alt=\"chiến dịch Clash de cartier kol kh&aacute;nh linh 2\" width=\"1000\" height=\"1401\"></p>\r\n<p>Trong bộ sưu tập Clash De Cartier lần n&agrave;y, Cartier đ&atilde; đem đến c&aacute;c thiết kế kh&ocirc;ng theo một khu&ocirc;n khổ nhất định. Thiết kế được lấy cảm hứng từ những chiếc đinh t&aacute;n vu&ocirc;ng h&igrave;nh kim tự th&aacute;p bằng v&agrave;ng hồng.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400681\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/Clash-De-Cartier-Phi-Phuong-Anh-1.jpg\" alt=\"chiến dịch Clash de cartier kol ph&iacute; phương anh 1\" width=\"1000\" height=\"1500\"></p>\r\n<p>Thoạt nh&igrave;n c&aacute;c thiết kế tr&ocirc;ng c&oacute; vẻ th&ocirc; cứng tuy nhi&ecirc;n ch&uacute;ng đều rất mượt m&agrave; khi chạm v&agrave;o đặc biệt những chi tiết đinh t&aacute;n tuy đ&atilde; được nối bằng những khớp nối nhỏ nhưng khi chạm v&agrave;o ch&uacute;ng vẫn c&oacute; ch&uacute;t linh hoạt tạo n&ecirc;n sự sống động. Đ&acirc;y ch&iacute;nh l&agrave; chi tiết chứng minh được đỉnh cao trong việc chế t&aacute;c trang sức nh&agrave; Cartier l&agrave; kh&ocirc;ng thể nh&igrave;n bằng mắt thường. Chỉ khi chạm v&agrave; sở hữu th&igrave; mới c&oacute; thể thấu hiểu cũng như chi&ecirc;m ngưỡng được kiệt t&aacute;c nghệ thuật n&agrave;y.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400682\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/Clash-De-Cartier-Tu-Hao-2.jpg\" alt=\"chiến dịch Clash de cartier kol t&uacute; hảo 2\" width=\"1000\" height=\"1499\"></p>\r\n<p>Giới hạn giữa nam v&agrave; nữ được x&oacute;a nh&ograve;a khi đến với tin thần Clash De Cartier, Bộ sưu tập ch&iacute;nh l&agrave; sự giao thoa giữa vẻ đẹp cổ điển c&ugrave;ng cảm hứng của thời đại mới.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400683\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/Clash-De-Cartier-Ho-Thu-Anh.jpg\" alt=\"chiến dịch Clash de cartier kol hồ thu anh\" width=\"1000\" height=\"1000\"></p>\r\n<p>Như lời tuy&ecirc;n bố h&ugrave;ng hồn từ Cartier &ldquo;Nam. Nữ. Kh&ocirc;ng ph&aacute;n x&eacute;t&rdquo; đ&acirc;y đ&iacute;ch thực l&agrave; tạo phẩm kinh điển trong vẻ đẹp t&acirc;n thời với tinh thần t&aacute;o bạo, tự chủ đầy mạnh mẽ.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400685\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/Clash-De-Cartier-Chloe-Nguyen.jpg\" alt=\"chiến dịch Clash de cartier kol chloe nguyễn\" width=\"3568\" height=\"5351\"></p>\r\n<p>C&ocirc; n&agrave;ng beauty blogger Chloe Nguyễn đ&atilde; đem đến một kh&iacute;a cạnh mới mẻ trong h&igrave;nh ảnh của m&igrave;nh th&ocirc;ng qua bộ sưu tập Clash De Cartier.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400684\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/Clash-De-Cartier-Quynh-Anh-Shyn-1.jpg\" alt=\"chiến dịch Clash de cartier kol quỳnh anh shyn 1\" width=\"1500\" height=\"2250\"></p>\r\n<p>Như một l&agrave;n gi&oacute; mới của Clash De Cartier, Quỳnh Anh Shyn kh&ocirc;ng chỉ thể hiện bản th&acirc;n m&igrave;nh th&ocirc;ng qua BST m&agrave; c&ograve;n đem đến th&ocirc;ng điệp qua g&oacute;c mặt sắt lẹm v&agrave; đầy kh&iacute; chất phụ nữ hiện đại.</p>\r\n<p>Chi&ecirc;m ngưỡng bộ ảnh chiến dịch Clash De Cartier với 6 KOL tại Việt Nam đại diện cho tinh thần &ldquo;Clash&rdquo; &nbsp;mang trong m&igrave;nh một vẻ đẹp t&acirc;n thời, ấn tượng v&agrave; đầy c&aacute; t&iacute;nh. Mỗi c&aacute; nh&acirc;n đều thể hiện được t&iacute;nh t&aacute;o tạo đầy nhiệt huyết nhưng kh&ocirc;ng k&eacute;m phần sang trọng.</p>\r\n<p><img class=\"aligncenter size-full wp-image-400697\" src=\"https://www.elle.vn/wp-content/uploads/2020/05/14/400679/nhung-kol-chien-dich-clash-de-cartier.jpg\" alt=\"những kol chiến dịch clash de cartier\" width=\"1678\" height=\"1124\"></p>\r\n<p>DAFC l&agrave; nh&agrave; ph&acirc;n phối trang sức Cartier tại Việt Nam</p>\r\n</div>', '', '', '6 cô nàng KOL thể hiện tinh thần táo tạo cùng chiến dịc', '6 cô nàng KOL thể hiện tinh thần táo tạo cùng chiến dịch Clash De Cartier', 'x c vc bcv b'),
(3, 'en', 'cv-s-g-df', 'cv s g df', '', '<p>&nbsp;vb gb g b f vdf&nbsp;</p>', '', '', 'vcb  b  vbn fg', 'xc b cv bv nvbq', 'f b  hg  sdv'),
(16, 'vi', 'nhung-su-kien-va-xu-huong-thoi-trang-noi-bat-nhat-thang-122018', 'Những sự kiện và xu hướng thời trang nổi bật nhất tháng 12/2018', '', '<h3>NG&Ocirc;I SAO MẠNG X&Atilde; HỘI V&Agrave; NHỮNG THƯƠNG HIỆU CAO CẤP</h3>\r\n<p>Năm 2018 chứng kiến những m&agrave;n &ldquo;kết giao&rdquo; đ&aacute;ng ch&uacute; ý của nhiều nh&agrave; mốt lớn thế giới tại Việt Nam với c&aacute;c ng&ocirc;i sao mạng x&atilde; hội. 2018 l&agrave; năm Ch&acirc;u B&ugrave;i nổi l&ecirc;n mạnh mẽ như một gương mặt thương hiệu được săn đ&oacute;n nhất. C&ugrave;ng với Kelbin Lei, Ch&acirc;u B&ugrave;i l&agrave; gương mặt được h&atilde;ng trang sức v&agrave; đồng hồ Cartier lựa chọn để tham gia sự kiện quảng b&aacute; trong v&agrave; ngo&agrave;i nước.</p>\r\n<p>Th&aacute;ng 10 vừa qua, Ch&acirc;u B&ugrave;i nhận lời mời của Chanel tới tham dự sự kiện thời trang &ndash; buổi tr&igrave;nh diễn BST Cruise của nh&agrave; mốt Ph&aacute;p được giới thiệu tại Bangkok, Th&aacute;i Lan.&nbsp;<a href=\"https://www.elle.vn/tin-thoi-trang/trang-suc-juste-un-clou-cartier\">Ch&acirc;u B&ugrave;i</a><span>&nbsp;</span>cũng trở th&agrave;nh gương mặt duy nhất từ Việt Nam tham dự Herm&egrave;s Carr&eacute; Club, sự kiện pop-up đặc biệt tại Singapore của nh&agrave; mốt lừng danh nước Ph&aacute;p. Một gương mặt kh&aacute;c l&agrave; Quỳnh Anh Shyn, c&ocirc; l&agrave; kh&aacute;ch mời của Louis Vuitton trong buổi giới thiệu BST Prefall 2018 tại Seoul hồi th&aacute;ng 4.</p>\r\n<div id=\"attachment_329285\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-1.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329285\" class=\"sự kiện thời trang 1 wp-image-329285 size-full\" title=\"sự kiện thời trang 1\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-1.jpg\" alt=\"sự kiện thời trang 1\" width=\"736\" height=\"951\"></a>\r\n<p id=\"caption-attachment-329285\" class=\"wp-caption-text\">Ch&acirc;u B&ugrave;i g&oacute;p mặt tại Chanel Cruise ở Bangkok</p>\r\n</div>\r\n<p>Trong khi đ&oacute;, Sơn T&ugrave;ng MTP đồng h&agrave;nh c&ugrave;ng nh&agrave; mốt Gucci. Nam ca sĩ c&oacute; mặt tại Hong Kong v&agrave;o th&aacute;ng 5 để tham dự buổi giới thiệu BST Thu &ndash; Đ&ocirc;ng 2018. Sơn T&ugrave;ng cũng l&agrave; người thể hiện c&aacute;c trang phục nam Gucci trong bộ ảnh của ELLE Man Việt Nam.</p>\r\n<div id=\"attachment_329286\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-2.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329286\" class=\"sự kiện thời trang 2 wp-image-329286\" title=\"sự kiện thời trang 2\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-2.jpg\" alt=\"sự kiện thời trang 2\" width=\"730\" height=\"862\"></a>\r\n<p id=\"caption-attachment-329286\" class=\"wp-caption-text\">Sơn T&ugrave;ng tại sự kiện của Gucci ở Hồng K&ocirc;ng</p>\r\n</div>\r\n<h3>N&Oacute;I KH&Ocirc;NG VỚI L&Ocirc;NG TH&Uacute;!</h3>\r\n<p>&ldquo;L&agrave;n s&oacute;ng&rdquo; ngưng sử dụng l&ocirc;ng th&uacute; tiếp tục được lan rộng trong l&agrave;ng thời trang cao cấp suốt năm 2018. Versace tuy&ecirc;n bố kh&ocirc;ng sử dụng l&ocirc;ng th&uacute; thật v&agrave;o th&aacute;ng 3. Đến th&aacute;ng 4, Maison Margiela cũng c&oacute; quyết định tương tự. C&aacute;c sự kiện thời trang tr&igrave;nh l&agrave;ng BST gần đ&acirc;y của h&atilde;ng cũng được NTK John Galliano s&aacute;ng tạo theo hướng kh&aacute;c, x&acirc;y dựng vẻ quyến rũ m&agrave; kh&ocirc;ng cần tới bộ l&ocirc;ng của c&aacute;c lo&agrave;i động vật.</p>\r\n<div id=\"attachment_329287\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-3.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329287\" class=\"sự kiện thời trang 3 wp-image-329287 size-full\" title=\"sự kiện thời trang 3\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-3.jpg\" alt=\"sự kiện thời trang 3\" width=\"843\" height=\"830\"></a>\r\n<p id=\"caption-attachment-329287\" class=\"wp-caption-text\">PETA trở th&agrave;nh cổ đ&ocirc;ng của Prada, tham dự c&aacute;c cuộc họp thường ni&ecirc;n của c&ocirc;ng ty v&agrave; ch&iacute;nh thức k&ecirc;u gọi chấm dứt mọi hoạt động b&aacute;n da động vật đặc biệt (da c&aacute; sấu, da thằn lằn, da rắn, da c&aacute; đuối (stingray)).</p>\r\n</div>\r\n<p>Th&aacute;ng 9, Burberry th&ocirc;ng b&aacute;o ngừng đốt h&agrave;ng tồn kho v&agrave; dừng b&aacute;n mặt h&agrave;ng thời trang sử dụng l&ocirc;ng th&uacute; thật. Gần đ&acirc;y nhất, Chanel cũng th&ocirc;ng b&aacute;o ngưng sử dụng l&ocirc;ng th&uacute; v&agrave; c&aacute;c loại da quý hiếm trong c&aacute;c thiết kế t&uacute;i x&aacute;ch của thương hiệu.</p>\r\n<div id=\"attachment_329288\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-4.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329288\" class=\"sự kiện thời trang 4 wp-image-329288\" title=\"sự kiện thời trang 4\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-4.jpg\" alt=\"sự kiện thời trang 4\" width=\"730\" height=\"973\"></a>\r\n<p id=\"caption-attachment-329288\" class=\"wp-caption-text\">Versace, Maison Margiela v&agrave; Burberry lần lượt tuy&ecirc;n bố kh&ocirc;ng sử dụng l&ocirc;ng th&uacute;.</p>\r\n</div>\r\n<h3>C&Aacute;C THƯƠNG VỤ S&Aacute;P NHẬP Đ&Aacute;NG CH&Uacute; Ý</h3>\r\n<p>Ng&agrave;y 25/9, tập đo&agrave;n Capri Holdings đứng đằng sau thương hiệu Michael Kors đ&atilde; th&ocirc;ng b&aacute;o mua thương hiệu Versace với gi&aacute; 2,1 tỷ đ&ocirc; la. Chiến lược của Capri Holdings d&agrave;nh cho Versace l&agrave; mở rộng nh&aacute;nh sản phẩm phụ kiện v&agrave; gi&agrave;y d&eacute;p từ 35% l&ecirc;n 60% doanh thu, ph&aacute;t triển thương mại điện tử, c&aacute;c k&ecirc;nh t&iacute;ch hợp, v&agrave; mở th&ecirc;m cửa h&agrave;ng mới ở Mỹ, ch&acirc;u &Acirc;u, ch&acirc;u &Aacute;. NTK Donatella Versace tiếp tục giữ vị tr&iacute; gi&aacute;m đốc s&aacute;ng tạo v&agrave; điều h&agrave;nh.</p>\r\n<div id=\"attachment_329291\" class=\"wp-caption aligncenter\"><img aria-describedby=\"caption-attachment-329291\" class=\"sự kiện thời trang 7 wp-image-329291 size-full\" title=\"sự kiện thời trang 7\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-7.jpg\" alt=\"sự kiện thời trang 7\" width=\"985\" height=\"709\">\r\n<p id=\"caption-attachment-329291\" class=\"wp-caption-text\">NTK Donatella Versace v&agrave; c&aacute;c cộng sự.</p>\r\n</div>\r\n<p>V&agrave;o th&aacute;ng 8, Thom Browne c&ocirc;ng bố gia nhập tập đo&agrave;n Ermenegildo Zegna để tập trung đầu tư cho quy tr&igrave;nh sản xuất v&agrave; ph&aacute;t triển hệ thống b&aacute;n lẻ to&agrave;n cầu. Trước đ&oacute; kh&ocirc;ng l&acirc;u, thương hiệu của NTK người Bỉ Dries van Noten được mua lại bởi Puiq để củng cố vị thế của tập đo&agrave;n gốc T&acirc;y Ban Nha trong thị trường thời trang. Ngo&agrave;i ra, thương hiệu Lanvin một lần nữa bị x&aacute;o trộn khi tập đo&agrave;n Fosun International của Trung Quốc mua lại.</p>\r\n<div id=\"attachment_329289\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-5.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329289\" class=\"sự kiện thời trang 5 wp-image-329289\" title=\"sự kiện thời trang 5\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-5.jpg\" alt=\"sự kiện thời trang 5\" width=\"730\" height=\"1495\"></a>\r\n<p id=\"caption-attachment-329289\" class=\"wp-caption-text\">Một thiết kế của Stella McCartney</p>\r\n</div>\r\n<p>Trong khi đ&oacute;, tập đo&agrave;n Kering b&aacute;n lại 50% cổ phần thương hiệu Stella McCartney cho ch&iacute;nh NTK n&agrave;y sau 17 năm gắn b&oacute;. Cuộc &ldquo;chia tay&rdquo; được c&ocirc;ng bố v&agrave;o cuối th&aacute;ng 2 v&agrave; đưa thương hiệu thời trang Stella McCartney bước v&agrave;o một giai đoạn mới, tự do nhưng cũng nhiều th&aacute;ch thức hơn.</p>\r\n<div id=\"attachment_329290\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-6.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329290\" class=\"sự kiện thời trang 6 wp-image-329290 size-large\" title=\"sự kiện thời trang 6\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-6-1024x607.jpg\" alt=\"sự kiện thời trang 6\" width=\"730\" height=\"433\"></a>\r\n<p id=\"caption-attachment-329290\" class=\"wp-caption-text\">NTK Stella McCartney nắm giữ to&agrave;n bộ cổ phần thương hiệu mang t&ecirc;n m&igrave;nh.</p>\r\n</div>\r\n<h3>&ldquo;SAO ĐỔI NG&Ocirc;I&rdquo; NĂM 2018</h3>\r\n<p>Phoebe Philo ch&iacute;nh thức rời khỏi Celine sau 10 năm gắn b&oacute;. Hedi Slimane, cựu gi&aacute;m đốc s&aacute;ng tạo tại nh&agrave; Saint Laurent, l&agrave; người thay vị tr&iacute; của Phoebe. Trong khi Hedi đ&atilde; giới thiệu BST Celine mới mang tới những cảm x&uacute;c đầy ngỡ ng&agrave;ng th&igrave; người h&acirc;m mộ vẫn ng&oacute;ng tin về điểm đến tiếp theo của Phoebe Philo.</p>\r\n<div id=\"attachment_329293\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-9.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329293\" class=\"sự kiện thời trang 9 wp-image-329293\" title=\"sự kiện thời trang 9\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-9.jpg\" alt=\"sự kiện thời trang 9\" width=\"730\" height=\"730\"></a>\r\n<p id=\"caption-attachment-329293\" class=\"wp-caption-text\">NTK Phoebe Philo</p>\r\n</div>\r\n<p>Tại Burberry, Riccardo Tisci, người nắm giữ vị tr&iacute; gi&aacute;m đốc s&aacute;ng tạo tại Givenchy từ năm 2005 &ndash; 2017 được chọn l&agrave; người thay thế cho Christopher Bailey khi &ocirc;ng rời khỏi Burberry sau 17 năm ch&egrave;o l&aacute;i. Tisci bắt đầu tiếp quản vị tr&iacute; n&agrave;y từ ng&agrave;y 12/3 năm nay.<span>&nbsp;</span><a href=\"https://www.elle.vn/tin-thoi-trang/thuong-hieu-celine-thay-doi-logo\">Thay đổi logo thương hiệu</a><span>&nbsp;</span>l&agrave; bước chuyển đổi đầu ti&ecirc;n của &ocirc;ng tại nh&agrave; mốt Anh.</p>\r\n<div id=\"attachment_329294\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-10.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329294\" class=\"sự kiện thời trang 10 wp-image-329294\" title=\"sự kiện thời trang 10\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-10.jpg\" alt=\"sự kiện thời trang 10\" width=\"730\" height=\"730\"></a>\r\n<p id=\"caption-attachment-329294\" class=\"wp-caption-text\">NTK Riccardo Tisci</p>\r\n</div>\r\n<div id=\"attachment_329295\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-11.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329295\" class=\"sự kiện thời trang 11 wp-image-329295 size-full\" title=\"sự kiện thời trang 11\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-11.jpg\" alt=\"sự kiện thời trang 11\" width=\"765\" height=\"911\"></a>\r\n<p id=\"caption-attachment-329295\" class=\"wp-caption-text\">Một hoạt động marketing th&ocirc;ng b&aacute;o sự thay đổi h&igrave;nh ảnh của Burberry.</p>\r\n</div>\r\n<p>C&aacute;c thương hiệu thời trang nam cũng c&oacute; những cuộc thay đổi &ldquo;thuyền trưởng&rdquo; đ&aacute;ng ch&uacute; ý. Ba th&aacute;ng sau khi rời nh&agrave; Louis Vuitton, Kim Jones trở th&agrave;nh t&acirc;n gi&aacute;m đốc s&aacute;ng tạo của Dior Men. Kim Jones thay thế cho Kris Van Assche, người rời đi sau khi nắm giữ vị tr&iacute; n&agrave;y năm 2007. Sau sự ra đi của Kim Jones, Virgil Abloh l&agrave; c&aacute;i t&ecirc;n thay thế vị tr&iacute; gi&aacute;m đốc s&aacute;ng tạo thời trang nam Louis Vuitton. Virgil Abloh s&aacute;ng lập thương hiệu Off-White, l&agrave; NTK da m&agrave;u với th&agrave;nh t&iacute;ch vang dội trong d&ograve;ng thời trang streetwear.</p>\r\n<div id=\"attachment_329292\" class=\"wp-caption aligncenter\"><a href=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-8.jpg\" class=\"auto_magnific\" rel=\"article_gallery\"><img aria-describedby=\"caption-attachment-329292\" class=\"sự kiện thời trang 8 wp-image-329292 size-full\" title=\"sự kiện thời trang 8\" src=\"https://www.elle.vn/wp-content/uploads/2018/12/31/elle-viet-nam-su-kien-thoi-trang-8.jpg\" alt=\"sự kiện thời trang 8\" width=\"973\" height=\"717\"></a>\r\n<p id=\"caption-attachment-329292\" class=\"wp-caption-text\">BST đầu ti&ecirc;n của Virgil Abloh cho Louis Vuitton ra mắt thắng 6/2018 tại Paris.</p>\r\n</div>', '', '', 'Những sự kiện và xu hướng thời trang nổi bật nhất tháng', 'Những sự kiện và xu hướng thời trang nổi bật nhất tháng 12/2018', 'f bnf vnd'),
(16, 'en', 'dv-d-vsnfb-nsd-v', 'dv d vsnfb nsd v', '', '<p>&nbsp;vn sd flfej sd</p>', '', '', 'vjfbsjdbvj', 'djvbsjbgrjwbdjvbvjabdjvb', 'sbvjsbdvjsbd'),
(17, 'vi', 'top-5-su-kien-thoi-trang-viet-nam-noi-bat-nhat-nam-2018', 'TOP 5 SỰ KIỆN THỜI TRANG VIỆT NAM NỔI BẬT NHẤT NĂM 2018', '', '<div class=\"desc\">\r\n<p>2018 l&agrave; một năm s&ocirc;i động của l&agrave;ng thời trang Việt Nam. Rất nhiều sự kiện thời trang quan trọng đ&atilde; diễn ra; đ&aacute;nh dấu sự khởi sắc của nền thời trang nước nh&agrave;. Trước khi đến với năm 2019, Harper&rsquo;s Bazaar điểm lại Top 5<span>&nbsp;</span><strong>sự kiện thời trang Việt Nam</strong><span>&nbsp;</span>nổi bật nhất 2018.</p>\r\n<h2><strong>Naomi Campbell đến Việt Nam</strong></h2>\r\n<p>Trong th&aacute;ng 5.2018, si&ecirc;u mẫu huyền thoại, Naomi Campbell bất ngờ đến Việt Nam. Cũng tại thời điểm đ&oacute; một chương tr&igrave;nh thực tế do c&ocirc; s&aacute;ng lập cũng đang diễn ra v&ograve;ng sơ tuyển tại th&agrave;nh phố Hồ Ch&iacute; Minh. Người h&acirc;m mộ đ&atilde; dự đo&aacute;n Naomi đến l&agrave;m kh&aacute;ch mời cho chương tr&igrave;nh. Thực chất, đ&acirc;y l&agrave; chuyến đi nghỉ dưỡng; kết hợp tham gia hoạt động x&atilde; hội trong chiến dịch #FashionRelief của c&ocirc;.</p>\r\n<p><img class=\"alignnone wp-image-2454958 size-large\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 1\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi-1024x599.jpg\" alt=\"top 5 su kien thoi trang Viet Nam noi bat nhat nam 2018 1\" width=\"1024\" height=\"599\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi-1024x599.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi-768x449.jpg 768w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi.jpg 1538w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"><em>Si&ecirc;u mẫu b&aacute;o đen Naomi Campbell b&iacute; mật đến Việt Nam c&ugrave;ng gi&aacute;m đốc s&aacute;ng tạo của Dior &ndash; Kim Jones&hellip;</em></p>\r\n<p>Điểm dừng ch&acirc;n của Naomi l&agrave; một resort 5 sao tại Cần Thơ. Si&ecirc;u mẫu đ&atilde; c&ugrave;ng người bạn của m&igrave;nh l&agrave; gi&aacute;m đốc s&aacute;ng tạo của Dior &ndash; Kim Jones; kh&aacute;m ph&aacute; văn h&oacute;a tại v&ugrave;ng đất n&agrave;y cũng như thăm c&aacute;c trường tiểu học tại đ&acirc;y. Naomi Campbell li&ecirc;n tục cập nhật h&igrave;nh ảnh v&agrave; video tại Việt Nam tr&ecirc;n Instagram c&aacute; nh&acirc;n. Ngo&agrave;i ra, c&ocirc; c&ograve;n chọn &aacute;o d&agrave;i của nh&agrave; thiết kế Nguyễn C&ocirc;ng Tr&iacute; để diện mặc trong một sự kiện diễn ra tại resort nơi Naomi nghỉ dưỡng.</p>\r\n<p><strong><img class=\"alignleft wp-image-2454959 size-large\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 2\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi2-1024x646.jpg\" alt=\"top 5 su kien thoi trang Viet Nam noi bat nhat nam 2018 2\" width=\"1024\" height=\"646\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi2-1024x646.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi2-768x484.jpg 768w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Naomi2.jpg 1427w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"></strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em>&hellip;C&ocirc; c&ograve;n mặc thiết kế &aacute;o d&agrave;i truyền thống Việt Nam của nh&agrave; thiết kế Nguyễn C&ocirc;ng Tr&iacute; tham gia một sự kiện</em></p>\r\n<p>Sau Coco Rocha, việc xuất hiện của si&ecirc;u mẫu Naomi Campbell l&agrave;&nbsp; sự kiện đ&aacute;ng được ghi nhận. Với tầm ảnh hưởng nhất định với nền thời trang thế giới; việc Naomi đến thăm Việt Nam, mặc trang phục truyền thống được l&agrave;m bởi nh&agrave; thiết kế Việt phần n&agrave;o quảng b&aacute; h&igrave;nh ảnh nước ta tr&ecirc;n bản đồ thời trang thế giới.</p>\r\n<h2><strong>C&ocirc;ng Tr&iacute; v&agrave; c&uacute; h&iacute;ch hợp t&aacute;c với nhữn</strong><strong>g si&ecirc;u sao quốc tế</strong></h2>\r\n<p>Nguyễn C&ocirc;ng Tr&iacute; l&agrave; nh&agrave; thiết kế thuộc thế hệ tiền bối của thời trang Việt Nam. &Ocirc;m giấc mơ lớn, C&ocirc;ng Tr&iacute; đang từng bước ph&aacute;t triển thương hiệu của m&igrave;nh vươn tầm quốc tế. Hội tụ những yếu tố đủ v&agrave; cần, anh kh&ocirc;ng ngừng l&agrave;m mới chiến lược x&acirc;y dựng thương hiệu lẫn tư duy thiết kế thời trong thời trang.</p>\r\n<p><strong><img class=\"alignnone wp-image-2454925 size-large\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 3\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Untitled-1-1024x431.jpg\" alt=\"top 5 su kien thoi trang Viet Nam noi bat nhat nam 2018 3\" width=\"1024\" height=\"431\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Untitled-1-1024x431.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Untitled-1-768x323.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"></strong><em>Những thiết kế c&ocirc;ng phu, mang đậm bản sắc ri&ecirc;ng kh&oacute; c&oacute; thể nhầm lẫn của nh&agrave; thiết kế<br></em></p>\r\n<p>Năm 2018 l&agrave; một năm ho&agrave;ng kim của thương hiệu Nguyễn C&ocirc;ng Tr&iacute;. H&igrave;nh ảnh trang phục do anh thiết kế phủ ngập mạng x&atilde; hội v&agrave; những đầu b&aacute;o quốc tế. Bởi thiết kế của anh được diện bởi h&agrave;ng loạt ng&ocirc;i sao thế giới. Đơn cử như: ng&ocirc;i sao nhạc Pop &ndash; Rihanna; ng&ocirc;i sao nhạc pop &ndash; Katy Perry; si&ecirc;u mẫu Naomi Campbell; ca sỹ Gwen Stefani&hellip;</p>\r\n<p><strong><img class=\"alignnone wp-image-2454921 size-large\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 4\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/CongTri-1024x411.jpg\" alt=\"top 5 su kien thoi trang Viet Nam noi bat nhat nam 2018 4\" width=\"1024\" height=\"411\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/CongTri-1024x411.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/CongTri-768x308.jpg 768w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/CongTri.jpg 1280w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"></strong><em>Những ng&ocirc;i sao quốc tế diện mặc thiết kế của Nguyễn C&ocirc;ng Tr&iacute;</em></p>\r\n<p>C&ocirc;ng Tr&iacute; được xem l&agrave; niềm tự h&agrave;o của nền thời trang trong nước, l&agrave; nh&agrave; thiết kế Việt đầu ti&ecirc;n tạo được c&uacute; h&iacute;ch. Hơn thế nữa, C&ocirc;ng Tr&iacute; c&ograve;n được giới thiệu trong quyển s&aacute;ch &ldquo;Fashion Embroidery&rdquo; v&agrave; một tạp ch&iacute; thời trang h&agrave;ng đầu của Anh Quốc trong ấn bản th&aacute;ng 12.2018 b&ecirc;n cạnh những nh&agrave; mốt thế giới danh tiếng kh&aacute;c.</p>\r\n<h2><span><strong>Fashion Voyage &ndash; Dạo bước tr&ecirc;n m&acirc;y, sự kiện thời trang kết hợp quảng b&aacute; du lịch th&agrave;nh c&ocirc;ng nhất<br></strong></span></h2>\r\n<p>Fashion Voyage &ndash; Dạo bước tr&ecirc;n m&acirc;y l&agrave; sự kiện thời trang kết hợp quảng b&aacute; du lịch ho&agrave;nh tr&aacute;ng v&agrave; th&agrave;nh c&ocirc;ng nhất trong năm 2018.<span>&nbsp;</span><em>Sự kiện thời trang Việt Nam</em><span>&nbsp;</span>n&agrave;y được thực hiện bởi đạo diễn Long Kan. S&agrave;n runway d&agrave;i 150m của cầu V&agrave;ng tr&ecirc;n đỉnh n&uacute;i B&agrave; N&agrave;, Đ&agrave; Nẵng l&agrave; điểm nhấn kh&ocirc;ng thể kh&ocirc;ng nhắc đến của chương tr&igrave;nh. Tr&igrave;nh diễn trong tiết trời se lạnh bao quanh bởi khung cảnh của thi&ecirc;n nhi&ecirc;n v&agrave; n&uacute;i rừng h&ugrave;ng vĩ, Fashion Voyage đem đến những cung bậc cảm x&uacute;c kh&aacute;c biệt đến kh&aacute;ch mời tham dự sự kiện.</p>\r\n<p><img class=\"aligncenter wp-image-2454923\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 5\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/thoi-trang-fashion-voyage-elle-viet-nam-20.jpg\" alt=\"top 5 su kien thoi trang Viet Nam noi bat nhat nam 2018 5\" width=\"921\" height=\"578\"><em>S&agrave;n runway d&agrave;i 150 của cầu V&agrave;ng tr&ecirc;n đỉnh n&uacute;i B&agrave; N&agrave;, Đ&agrave; Nẵng l&agrave; tố chất tạo n&ecirc;n th&agrave;nh c&ocirc;ng cho sự kiện</em></p>\r\n<p>Chung Thanh Phong; L&ecirc; Thanh H&ograve;a; L&ecirc; Ngọc L&acirc;m; A Sai Ta l&agrave; những nh&agrave; thiết kế đ&atilde; tham gia tr&igrave;nh diễn bộ sưu tập tại sự kiện Fashion Voyage. Mỗi bộ sưu tập đều mang những dấu ấn thiết kế ri&ecirc;ng biệt. Ngo&agrave;i ra, thảm đỏ của sự kiện c&ograve;n b&ugrave;ng nổ khi quy tụ những gương mặt đ&igrave;nh đ&aacute;m. Đơn cử như: Thanh Hằng; H&rsquo;Hen Ni&ecirc;; Linh Nga; Trương Tri Tr&uacute;c Diễm; Midu; Jolie Nguyễn; Th&uacute;y V&acirc;n&hellip;</p>\r\n<p><strong><img class=\"alignnone wp-image-2454966 size-large\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 6\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Fashion-Voyage2-1024x739.jpg\" alt=\"\" width=\"1024\" height=\"739\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Fashion-Voyage2-1024x739.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Fashion-Voyage2-768x554.jpg 768w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Fashion-Voyage2.jpg 1542w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"></strong></p>\r\n<p><img class=\"alignnone size-large wp-image-2454967\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/FashionVoyage-1024x465.jpg\" alt=\"\" width=\"1024\" height=\"465\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/FashionVoyage-1024x465.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/FashionVoyage-768x349.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"></p>\r\n<p><em>C&aacute;c nh&agrave; thiết kế tham gia tr&igrave;nh diễn v&agrave; c&aacute;c mỹ nh&acirc;n &ldquo;lộng lẫy v&aacute;y &aacute;o&rdquo; tại Fashion Voyage</em></p>\r\n<p>Kể từ sau show diễn kết th&uacute;c, h&igrave;nh ảnh c&acirc;y Cầu V&agrave;ng được quảng b&aacute; rộng r&atilde;i thu h&uacute;t rất nhiều du kh&aacute;ch đến thưởng l&atilde;m. C&aacute;c đầu b&aacute;o thời trang c&oacute; uy t&iacute;n trong nước v&agrave; quốc tế cũng đưa tin về sự kiện v&agrave; s&acirc;n khấu thời trang độc lạ n&agrave;y. Fashion Voyage khởi tạo xu hướng cho sự kiện thời trang kết hợp quảng b&aacute; du lịch</p>\r\n<h2><strong>Nh&agrave; thiết kế Việt Nam v&agrave; những show diễn mang đậm dấu ấn<br></strong></h2>\r\n<p>Năm 2018 l&agrave; một năm b&ugrave;ng nổ của thời trang Việt Nam. Nh&agrave; thiết kế Việt đ&atilde; v&agrave; đang tổ chức c&aacute;c s&agrave;n diễn giới thiệu bộ sưu tập được đầu tư c&ocirc;ng phu; s&acirc;n khấu quy m&ocirc; v&agrave; chiến lược marketing hợp thời.</p>\r\n<p><img class=\"alignnone size-large wp-image-2454973\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/top5event-1024x511.jpg\" alt=\"\" width=\"1024\" height=\"511\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/top5event-1024x511.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/top5event-768x383.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"><em>Li Lam, L&acirc;m Gia Khang, Chung Thanh Phong, L&ecirc; Thanh H&ograve;a&hellip; l&agrave; những c&aacute;i t&ecirc;n được nhắc đến nhiều nhất trong năm qua</em></p>\r\n<p>Trong đ&oacute;, những s&agrave;n diễn nổi bật phải nhắc đến gồm nh&agrave; thiết kế Chung Thanh Phong. Với lợi thế kh&ocirc;ng gian tối giản của đường n&eacute;t kiến tr&uacute;c v&agrave; gam m&agrave;u trắng của White Palace anh đ&atilde; dựng những cột trụ m&agrave;n h&igrave;nh để tạo điểm nhấn tập trung v&agrave;o trang phục. C&ograve;n L&acirc;m Gia Khang biến kh&ocirc;ng gian Park Hyatt th&agrave;nh buổi h&ograve;a nhạc đậm chất cổ điển &Acirc;u Ch&acirc;u.</p>\r\n<p>Nh&agrave; thiết kế L&ecirc; Thanh H&ograve;a đem bộ sưu tập tr&igrave;nh diễn tr&ecirc;n du thuyền triệu đ&ocirc; tại Vịnh Hạ Long. Li Lam với bản ng&atilde; nghệ sỹ. Chị tận dụng kỹ thuật Digital Visual Art để biến kh&ocirc;ng gian tưởng chừng đơn giản trở n&ecirc;n nghệ thuật hơn bao giờ hết.</p>\r\n<p><img class=\"alignnone size-large wp-image-2454974 aligncenter\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Top5-1024x796.jpg\" alt=\"\" width=\"1024\" height=\"796\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/Top5-1024x796.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/Top5-768x597.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"><em>Những buổi tr&igrave;nh diễn quy m&ocirc; của c&aacute;c nh&agrave; thiết kế Việt Nam trong năm 2018</em></p>\r\n<p>Nh&agrave; thiết kế Việt thể hiện sự hội nhập khi c&aacute;c bộ sưu tập được đầu tư kỹ lưỡng từ &yacute; tưởng đến kh&acirc;u sản xuất; cập nhật xu hướng thời trang của thế giới. Điều đ&oacute; cho thấy, nền thời trang Việt đang tr&ecirc;n đ&agrave; khởi sắc v&agrave; ph&aacute;t triển hơn trong tương lai.</p>\r\n<h2><strong>Nh&agrave; thiết kế Đỗ Mạnh Cường kh&eacute;p lại năm 2018 bằng show diễn quy m&ocirc;</strong></h2>\r\n<p>Trong những ng&agrave;y cuối năm 2018, nh&agrave; thiết kế Đỗ Mạnh Cường đ&atilde; giới thiệu bộ sưu tập Thu Đ&ocirc;ng 2018 với t&ecirc;n gọi Mix &amp; Match tại trung t&acirc;m triển l&atilde;m SECC. Với bộ sưu tập Thu-Đ&ocirc;ng 2018, NTK Đỗ Mạnh Cường mang đến kh&ocirc;ng gian thời trang đa sắc m&agrave;u; đa phong c&aacute;ch. Ngo&agrave;i ra, bộ sưu tập c&ograve;n gợi &yacute; c&aacute;ch kết hợp trang phục thời thượng ngay tr&ecirc;n s&agrave;n diễn; vừa lăng x&ecirc; gam m&agrave;u hồng xu hướng trong năm 2019.</p>\r\n<p><img class=\"size-large wp-image-2454297\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2018/12/201802812-ntk-do-manh-cuong-242-MIT_MATCH-KIENGCAN--1024x683.jpg\" alt=\"\" width=\"1024\" height=\"683\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2018/12/201802812-ntk-do-manh-cuong-242-MIT_MATCH-KIENGCAN--1024x683.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2018/12/201802812-ntk-do-manh-cuong-242-MIT_MATCH-KIENGCAN--768x512.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"><em>S&agrave;n diễn t&aacute;i hiện những con phố cổ của H&agrave; Nội xưa c&ograve;n đọng lại một khoảng trời Paris trong k&yacute; ức của Đỗ Mạnh Cường</em></p>\r\n<p>S&agrave;n diễn lấy cảm hứng từ những con phố cổ của H&agrave; Nội. Nh&agrave; thiết kế Đỗ Mạnh Cường đ&atilde; chi số tiền kh&ocirc;ng nhỏ phục dựng r&otilde; n&eacute;t chất cổ k&iacute;nh v&agrave; l&atilde;ng mạn của H&agrave; Nội xưa. Cũng như một khoảng trời Paris c&ograve;n trong k&yacute; ức. Bộ sưu tập được chia th&agrave;nh 3 phần, bao gồm: tối giản với hai gam m&agrave;u trắng đen; những thiết kế sắc hồng; phần cuối được nh&agrave; thiết kế h&ograve;a phối đậm chất thời trang đường phố. Bộ sưu tập được nh&agrave; thiết kế chế t&aacute;c với những chi tiết diềm xếp.</p>\r\n<p><img class=\"alignnone wp-image-2454296\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2018/12/201802812-ntk-do-manh-cuong-036-MIT_MATCH-KIENGCAN-.jpg\" alt=\"201802812-ntk-do-manh-cuong-036 MIT_MATCH KIENGCAN\" width=\"920\" height=\"810\"><img class=\"alignnone wp-image-2454986 size-large\" title=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 10\" src=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/DMC-1024x365.jpg\" alt=\"Top 5 sự kiện thời trang Việt Nam nổi bật nhất năm 2018 10\" width=\"1024\" height=\"365\" srcset=\"https://bazaarvietnam.vn/wp-content/uploads/2019/01/DMC-1024x365.jpg 1024w, https://bazaarvietnam.vn/wp-content/uploads/2019/01/DMC-768x273.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\"><em>C&aacute;c ng&ocirc;i sao quy tụ tr&ecirc;n thảm đỏ v&agrave; những người mẫu nổi tiếng tr&igrave;nh diễn tại show diễn của nh&agrave; thiết kế Đỗ Mạnh Cường</em></p>\r\n<h4><strong>Ngo&agrave;i ra, yếu tố tạo n&ecirc;n th&agrave;nh c&ocirc;ng l&agrave; quy c&aacute;ch tổ chức show diễn cũng như kh&aacute;ch mời tham dự chương tr&igrave;nh. Những gương mặt đ&igrave;nh đ&aacute;m của ng&agrave;nh giải tr&iacute; đ&atilde; c&oacute; mặt để ủng hộ nh&agrave; thiết kế. Đơn cử như: Đ&agrave;m Vĩnh Hưng; Ng&ocirc; Thanh V&acirc;n; Xu&acirc;n Lan; T&oacute;c Ti&ecirc;n; Linh Nga; Đặng Thu Thảo; Diễm My 9x; H&rsquo;Hen Ni&ecirc;; V&otilde; Ho&agrave;ng Yến; M&acirc;u Thủy; Angela Phương Trinh; Kỳ Duy&ecirc;n; Th&uacute;y V&acirc;n&hellip; c&agrave;ng chứng tỏ độ &ldquo;hot&rdquo; của nh&agrave; thiết kế Đỗ Mạnh Cường.</strong></h4>\r\n<p align=\"JUSTIFY\"><em>Harper&rsquo;s Bazaar Việt Nam</em></p>\r\n<p>&nbsp;</p>\r\n</div>', '', '', 'TOP 5 SỰ KIỆN THỜI TRANG VIỆT NAM NỔI BẬT NHẤT NĂM 2018', 'TOP 5 SỰ KIỆN THỜI TRANG VIỆT NAM NỔI BẬT NHẤT NĂM 2018', 'd jvsd jsd j'),
(17, 'en', 'dbfsib-ugdurfghuduf', 'dbfsib ugdurfghuduf', '', '<p>&nbsp;vn sd flfej sd</p>', '', '', 'f gfrgifgsiudgf', 'iu ègsudgfsud', ' gfiugsd');
