(19, 'vi', 'dino-vu-sau-khi-bi-che-an-mac-nhu-cau-be-di-dam-sen-nuoc-thay-buon-va-ton-thuong-se-can-nhac-ky-khi-tham-gia-event-thoi-trang-sau-nay', 'Dino Vũ sau khi bị chê ăn mặc như \"cậu bé đi Đầm Sen nước\": Thấy buồn và tổn thương, sẽ cân nhắc kỹ khi tham gia event thời trang sau này', '', '<p><span>Xuất hiện tại sự kiện thời trang của Gucci vừa qua, hội bạn th&acirc;n của Kh&aacute;nh Linh gồm Giang ơi, Dino Vũ &ndash; những Youtubers sở hữu lượng subscribers đ&ocirc;ng đảo đều chọn cho m&igrave;nh những set đồ chỉn chu nhất. Tuy nhi&ecirc;n, drama xảy đến khi T.F.W, một fanpage về thời trang kh&aacute; c&oacute; tiếng lại l&ecirc;n tiếng d&egrave; bỉu, ch&ecirc; bai v&agrave; d&ugrave;ng những lời lẽ khiếm nh&atilde; để b&igrave;nh luận về phong c&aacute;ch của nh&oacute;m bạn.</span></p>\r\n<div class=\"VCSortableInPreviewMode LayoutAlbumWrapper alignJustify active\" type=\"LayoutAlbum\">\r\n<div class=\"LayoutAlbumContent\">\r\n<div class=\"LayoutAlbumRow\">\r\n<figure class=\"LayoutAlbumItem\"><a href=\"https://kenh14cdn.com/2019/12/20/dinovux801229711723718241600887393500535690122940n-1576824538507764479495.jpg\" title=\"\" data-title=\"\" data-thumbnail=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/dinovux801229711723718241600887393500535690122940n-1576824538507764479495.jpg\" rel=\"lightbox\" class=\"sp-img-zoom\"><img title=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 1.\" alt=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 1.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/dinovux801229711723718241600887393500535690122940n-1576824538507764479495.jpg\" url=\"https://kenh14cdn.com/2019/12/20/dinovux801229711723718