;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 1.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/befunky-collage-1-1576816486286132962126.jpg\" url=\"https://kenh14cdn.com/2019/12/20/befunky-collage-1-1576816486286132962126.jpg\" w=\"500\" h=\"655\" photoid=\"0deb0200-22e2-11ea-bf6a-31a8d4324450\"></a></figure>\r\n</div>\r\n</div>\r\n<div class=\"LayoutAlbumCaptionWrapper\">\r\n<p class=\"LayoutAlbumCaption\" data-placeholder=\"[nhập ch&uacute; th&iacute;ch]\">Những h&igrave;nh ảnh của Vũ Dino v&agrave; Kh&aacute;nh Linh, Giang Ơi tại sự kiện Gucci.</p>\r\n</div>\r\n</div>\r\n<div class=\"VCSortableInPreviewMode LayoutAlbumWrapper alignJustify active\" type=\"LayoutAlbum\">\r\n<div class=\"LayoutAlbumContent\">\r\n<div class=\"LayoutAlbumRow\">\r\n<figure class=\"LayoutAlbumItem\"><a href=\"https://kenh14cdn.com/2019/12/20/8035210625796480587700913169053443398565888o-1576815872226877558306.jpg\" title=\"\" data-title=\"\" data-thumbnail=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/8035210625796480587700913169053443398565888o-1576815872226877558306.jpg\" rel=\"lightbox\" class=\"sp-img-zoom\"><img title=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 2.\" alt=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/8035210625796480587700913169053443398565888o-1576815872226877558306.jpg\" url=\"https://kenh14cdn.com/2019/12/20/8035210625796480587700913169053443398565888o-1576815872226877558306.jpg\" w=\"1242\" h=\"648\" photoid=\"a06650a0-22e0-11ea-bf6a-31a8d4324450\"></a></figure>\r\n<figure class=\"LayoutAlbumItem\"><a href=\"https://kenh14cdn.com/2019/12/20/796001542579648128770084115633005078249472o-15768158722231254466970.jpg\" title=\"\" data-title=\"\" data-thumbnail=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/796001542579648128770084115633005078249472o-15768158722231254466970.jpg\" rel=\"lightbox\" class=\"sp-img-zoom\"><img title=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 2.\" alt=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 2.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/796001542579648128770084115633005078249472o-15768158722231254466970.jpg\" url=\"https://kenh14cdn.com/2019/12/20/796001542579648128770084115633005078249472o-15768158722231254466970.jpg\" w=\"1242\" h=\"491\" photoid=\"a02b1c60-22e0-11ea-aabb-f3df9486a012\"></a></figure>\r\n</div>\r\n</div>\r\n<div class=\"LayoutAlbumCaptionWrapper\">\r\n<p class=\"LayoutAlbumCaption\" data-placeholder=\"[nhập ch&uacute; th&iacute;ch]\">Fanpage T.F.W. vừa c&oacute; một b&agrave;i đăng với nội dung \"Một cơ số Youtubers Việt Nam đang rải ph&egrave;n tại sự kiện Gucci\". Điều n&agrave;y khiến netizen kh&ocirc;ng khỏi nghĩ đến đối tượng m&agrave; fanpage đang &aacute;m chỉ l&agrave; hội bạn của Kh&aacute;nh Linh, Giang ơi v&agrave; Dino Vũ. Kh&ocirc;ng dừng lại ở đ&oacute;, fanpage n&agrave;y đưa ra quan điểm: \"Sau Gucci đừng đưa đồ cho Youtuber nữa.\"</p>\r\n</div>\r\n</div>\r\n<div class=\"VCSortableInPreviewMode active\" type=\"Photo\">\r\n<div><a href=\"https://kenh14cdn.com/2019/12/20/7948374625796482187700753932389657270026240o-15768158722251505153702.jpg\" data-fancybox-group=\"img-lightbox\" title=\"B&igrave;nh luận mang đậm t&iacute;nh c&ocirc;ng k&iacute;ch của fanpage\" target=\"_blank\" class=\"detail-img-lightbox\" rel=\"noopener noreferrer\"><img src=\"https://kenh14cdn.com/thumb_w/620/2019/12/20/7948374625796482187700753932389657270026240o-15768158722251505153702.jpg\" id=\"img_9ff2ce50-22e0-11ea-bf6a-31a8d4324450\" w=\"1241\" h=\"1380\" alt=\"Dino Vũ sau khi bị ch&ecirc; ăn mặc như cậu b&eacute; đi Đầm Sen nước: Thấy buồn v&agrave; tổn thương, sẽ c&acirc;n nhắc kỹ khi tham gia event thời trang sau n&agrave;y - Ảnh 3.\" title=\"Dino Vũ sau khi bị ch&ecirc; ăn mặc như cậu b&eacute; đi Đầm Sen nước: Thấy buồn v&agrave; tổn thương, sẽ c&acirc;n nhắc kỹ khi tham gia event thời trang sau n&agrave;y - Ảnh 3.\" rel=\"lightbox\" photoid=\"9ff2ce50-22e0-11ea-bf6a-31a8d4324450\" type=\"photo\" data-original=\"https://kenh14cdn.com/2019/12/20/7948374625796482187700753932389657270026240o-15768158722251505153702.jpg\" width=\"\" height=\"\" class=\"lightbox-content\"></a></div>\r\n<div class=\"PhotoCMS_Caption\">\r\n<p data-placeholder=\"[nhập ch&uacute; th&iacute;ch]\">B&igrave;nh luận mang đậm t&iacute;nh c&ocirc;ng k&iacute;ch của fanpage</p>\r\n</div>\r\n</div>\r\n<p>V&agrave; v&agrave;o s&aacute;ng nay, Kh&aacute;nh Linh cũng đăng đ&agrave;n đ&aacute;p trả những b&igrave;nh luận thiếu thiện ch&iacute; đ&oacute; với những d&ograve;ng chia sẻ d&agrave;i, b&ecirc;nh vực 2 người bạn th&acirc;n l&agrave; Giang Ơi v&agrave; Dino Vũ.<span>&nbsp;</span><b>Khi ch&uacute;ng t&ocirc;i li&ecirc;n hệ ri&ecirc;ng với Dino Vũ, anh cho biết bản th&acirc;n<span>&nbsp;cảm thấy buồn v&agrave; tổn thương khi đọc những b&igrave;nh luận so s&aacute;nh mang t&iacute;nh x&uacute;c phạm, những lời lẽ kh&ocirc;ng hay về m&igrave;nh m&agrave; kh&ocirc;ng hề c&oacute; t&iacute;nh x&acirc;y dựng để tốt l&ecirc;n. Anh cũng n&oacute;i th&ecirc;m việc so s&aacute;nh style ăn mặc với những đối tượng l&agrave;m những nghề nghiệp kh&aacute;c trong x&atilde; hội n&oacute; v&ocirc; c&ugrave;ng khiếm nh&atilde; v&agrave; thậm ch&iacute; c&ocirc;ng việc Youtuber anh đang l&agrave;m cũng bị đem ra để b&agrave;n t&aacute;n.</span></b></p>\r\n<div id=\"admzone474524\" class=\"wp100 clearfix\">\r\n<div id=\"zone-474524\">\r\n<div id=\"share-jvrit1l1\">\r\n<div id=\"placement-566957\" revenue=\"cpm\">\r\n<div id=\"banner-474524-567067\">\r\n<div id=\"slot-1-474524-567067\">\r\n<div id=\"ssppagebid_2148\">\r\n<div id=\"sspbid_3191\" data-ssp=\"sspbid_3191\" class=\"banner0\" data-admssprqid=\"082a292f-6ee4-457c-a6d3-16918c5c27dc-5ec660b3\" data-width=\"640\" data-height=\"320\" data-sspdefault=\"default\"><iframe width=\"0\" height=\"0\" data-mce-fragment=\"1\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>Khi được hỏi về việc c&oacute; &yacute; định tham dự tiếp những sự kiện thời trang sau \"drama\" lần n&agrave;y hay kh&ocirc;ng, Divo Vũ n&oacute;i: \"Dino nghĩ l&agrave; m&igrave;nh sẽ phải c&acirc;n nhắc kĩ trước khi nhận lời tham gia\".</p>\r\n<div class=\"VCSortableInPreviewMode LayoutAlbumWrapper alignJustify active\" type=\"LayoutAlbum\">\r\n<div class=\"LayoutAlbumContent\">\r\n<div class=\"LayoutAlbumRow\">\r\n<figure class=\"LayoutAlbumItem\"><a href=\"https://kenh14cdn.com/2019/12/20/dinovux744017311537977625395818271228829894094744n-15768231347091993777370.jpg\" title=\"\" data-title=\"\" data-thumbnail=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/dinovux744017311537977625395818271228829894094744n-15768231347091993777370.jpg\" rel=\"lightbox\" class=\"sp-img-zoom\"><img title=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 4.\" alt=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 4.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/dinovux744017311537977625395818271228829894094744