n.com/thumb_w/660/2019/12/20/dinovux672615183714821670880014976448718388584899n-15768231347031923160079.jpg\" rel=\"lightbox\" class=\"sp-img-zoom\"><img title=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 4.\" alt=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 4.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/dinovux672615183714821670880014976448718388584899n-15768231347031923160079.jpg\" url=\"https://kenh14cdn.com/2019/12/20/dinovux672615183714821670880014976448718388584899n-15768231347031923160079.jpg\" w=\"1080\" h=\"1350\" photoid=\"8ad132d0-22f1-11ea-a05e-93c5dde907d6\"></a></figure>\r\n<figure class=\"LayoutAlbumItem\"><a href=\"https://kenh14cdn.com/2019/12/20/befunky-collage-4-1576823134701681006116.jpg\" title=\"\" data-title=\"\" data-thumbnail=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/befunky-collage-4-1576823134701681006116.jpg\" rel=\"lightbox\" class=\"sp-img-zoom\"><img title=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 4.\" alt=\"Dino Vũ sau khi bị ch&amp;#234; ăn mặc như &amp;amp;quot;cậu b&amp;#233; đi Đầm Sen nước&amp;amp;quot;: Thấy buồn v&amp;#224; tổn thương, sẽ c&amp;#226;n nhắc kỹ khi tham gia event thời trang sau n&amp;#224;y - Ảnh 4.\" src=\"https://kenh14cdn.com/thumb_w/660/2019/12/20/befunky-collage-4-1576823134701681006116.jpg\" url=\"https://kenh14cdn.com/2019/12/20/befunky-collage-4-1576823134701681006116.jpg\" w=\"500\" h=\"655\" photoid=\"8a875890-22f1-11ea-ab9a-2b12db65bd2c\"></a></figure>\r\n</div>\r\n</div>\r\n<div class=\"LayoutAlbumCaptionWrapper\">\r\n<p class=\"LayoutAlbumCaption\" data-placeholder=\"[nhập ch&uacute; th&iacute;ch]\">Phong c&aacute;ch thời trang của Dino Vũ cũng rất cool ngầu v&agrave; n&agrave;y nọ đấy chứ!</p>\r\n</div>\r\n</div>\r\n<p>Nguy&ecirc;n văn chia sẻ của Dino Vũ tr&ecirc;n trang c&aacute; nh&acirc;n:</p>\r\n<div class=\"VCSortableInPreviewMode active\" data-back=\"#FFFEC7\" data-border=\"#FF7D00\" id=\"ObjectBoxContent_1576822103572\" type=\"content\">\r\n<div placeholder=\"[nhập nội dung]\">\r\n<p><span>Bản th&acirc;n m&igrave;nh chưa bao giờ l&agrave; một người tự tin l&agrave; ăn mặc đẹp, thậm ch&iacute; mang tiếng mặc xấu kha kh&aacute; nhiều lần. N&ecirc;n bị ch&ecirc; mặc xấu m&igrave;nh cũng k buồn t&iacute; n&agrave;o, nhưng qua những lần bị ch&ecirc; đ&oacute; th&igrave; m&igrave;nh r&uacute;t kinh nghiệm hơn cho những lần sau.</span></p>\r\n<p>Quan điểm của m&igrave;nh r&otilde; r&agrave;ng ko cần phải mặc đẹp xuất sắc l&agrave;m g&igrave;, đ&oacute; l&agrave; c&ocirc;ng việc của những bạn kh&aacute;c. C&ograve;n đi đến một sự kiện được mời th&igrave; phải chỉn chu v&agrave; đ&uacute;ng dresscode đ&oacute; thể hiện sự lịch sự v&agrave; t&ocirc;n trọng người mời. Mặc đồ kh&ocirc;ng li&ecirc;n quan đến sự kiện l&agrave; một sự bất lịch sự hơn nhiều lần.</p>\r\n<p>C&ograve;n n&oacute;i về những lời ch&ecirc; bai m&agrave; miệt thị nghề nghiệp đ&oacute; ho&agrave;n to&agrave;n k phải l&agrave; g&oacute;p &yacute; mang t&iacute;nh x&acirc;y dựng. Chỉ l&agrave; những lời lẽ độc hại để thoả m&atilde;n c&aacute;i t&ocirc;i của một số người giấu mặt m&agrave; th&ocirc;i. Nhưng một khi đ&atilde; bước ch&acirc;n v&agrave;o nghề n&agrave;y m&igrave;nh đ&atilde; hiểu rằng c&oacute; những người họ ko coi m&igrave;nh như một con người cần được t&ocirc;n trọng m&agrave; chỉ l&agrave; những \"đối tượng giải tr&iacute;\", chỉ ước rằng d&ugrave; mong manh, m&igrave;nh được c&aacute;c bạn coi như một con người c&aacute;c bạn gặp ngo&agrave;i đời, c&oacute; cảm x&uacute;c v&agrave; c&oacute; tự trọng.</p>\r\n<div class=\"VCSortableInPreviewMode noCaption\" type=\"PhotoInContentBox\"></div>\r\n</div>\r\n</div>\r\n<p>Kh&aacute;nh Linh cũng đ&atilde; c&oacute; b&agrave;i chia sẻ kh&aacute; d&agrave;i như sau:</p>\r\n<div class=\"VCSortableInPreviewMode active\" data-back=\"#FFFEC7\" data-border=\"#FF7D00\" id=\"ObjectBoxContent_1576822204960\" type=\"content\">\r\n<div placeholder=\"[nhập nội dung]\">\r\n<p>YOUTUBER Đi Sự Kiện Thời Trang, N&ecirc;n hay Kh&ocirc;ng?</p>\r\n<p>\"YOUTUBER RẢI PH&Egrave;N\" ...\" NH&Agrave; QU&Ecirc; RA PHỐ\"</p>\r\n<p>Chắc mọi người c&ograve;n nhớ Hội Bạn Th&acirc;n mới dự event thời trang c&ugrave;ng nhau h&ocirc;m rồi. Chuyện chẳng c&oacute; g&igrave; nếu như kh&ocirc;ng c&oacute; người gửi cho Linh một v&agrave;i lời nhận x&eacute;t từ một fanpage thời trang nọ, với những lời lẽ ch&ecirc; bai, mỉa mai đầy t&iacute;nh miệt thị v&agrave; hạ thấp Youtuber ch&uacute;ng t&ocirc;i.</p>\r\n<p>L&agrave; \"người trong ng&agrave;nh\" thời trang, lần đầu ti&ecirc;n được c&ugrave;ng cả hội dự một event thời trang Linh rất vui.</p>\r\n<p>Kh&ocirc;ng chỉ vui v&igrave; c&ugrave;ng được đi với những người bạn th&acirc;n nhất, m&agrave; c&ograve;n v&igrave; sức ảnh hưởng của c&aacute;c Youtuber Việt Nam giờ đ&atilde; đủ lớn để Brand thời trang quốc tế đồng &yacute; duyệt những profile của những influencer c&oacute; sức ảnh hưởng trong cộng đồng, m&agrave; kh&ocirc;ng-chỉ-l&agrave;-fashionista. Phải n&oacute;i th&ecirc;m rằng kh&ocirc;ng hề dễ d&agrave;ng để một brand quốc tế duyệt profile của một influencer. V&agrave; một bữa tiệc thời trang nay c&oacute; th&ecirc;m những c&aacute; nh&acirc;n nổi bật từ những ng&agrave;nh nghề kh&aacute;c như lifestyle blogger, food blogger, fashion blogger. Linh cho rằng rất th&uacute; vị.</p>\r\n<p>Việc thay đổi th&oacute;i quen xem h&igrave;nh ảnh sang video khiến những Youtuber l&agrave; những người c&oacute; sức ảnh hưởng cực k&igrave; lớn ở thời điểm hiện tại, thế n&ecirc;n việc những thương hiệu lớn l&agrave;m việc với những youtuber nổi tiếng kh&ocirc;ng c&ograve;n lạ lẫm.</p>\r\n<p>Louis Vuitton đ&atilde; kết hợp với Emma Chamberlain - youtuber với 8,5 triệu follower, hay Dior với Tanya Bur hay Jackie Aina để tạo n&ecirc;n những chiến dịch truyền th&ocirc;ng đến những người d&ugrave;ng thế hệ millennials.</p>\r\n<p>V&agrave; thế n&ecirc;n, ch&uacute;ng m&igrave;nh được mời.</p>\r\n<p>Nhưng điều l&agrave;m m&igrave;nh bất ngờ nhất l&agrave; c&aacute;ch anh Dino v&agrave; chị Giang Ơi chuẩn bị cho sự kiện n&agrave;y.</p>\r\n<p>Phải chia sẻ cho c&aacute;c bạn rằng để chuẩn bị cho một sự kiện thời trang thế n&agrave;y kh&ocirc;ng hề đơn giản. Với những fashionista như Linh, tụi m&igrave;nh đều phải l&agrave;m việc với nh&atilde;n h&agrave;ng nhiều ng&agrave;y trời, để chọn lựa trang phục cho ph&ugrave; hợp. Sau đ&oacute; l&agrave; qu&aacute; tr&igrave;nh fitting - thử đồ, thử phụ kiện, t&uacute;i, gi&agrave;y, hoa tai, v.v. c&ugrave;ng với stylist ri&ecirc;ng, stylist của nh&atilde;n h&agrave;ng, v&agrave; c&aacute;c cố vấn thương hiệu của nh&atilde;n h&agrave;ng để sao cho khi xuất hiện, ch&uacute;ng m&igrave;nh lu&ocirc;n c&oacute; h&igrave;nh ảnh đẹp, thời trang, v&agrave; mang tinh thần của nh&atilde;n h&agrave;ng nhưng vẫn nổi bật được phong c&aacute;ch c&aacute; nh&acirc;n nhất.</p>\r\n<p>C&ograve;n đối với anh Dino, chị Giang v&agrave; một số c&aacute;c kh&aacute;ch mời kh&aacute;c th&igrave; sao? Tuy kh&ocirc;ng được nh&atilde;n h&agrave;ng phục sức như c&aacute;c fashionista, nhưng h&ocirc;m đ&oacute; mọi người đều chuẩn bị cực k&igrave; kĩ c&agrave;ng, từ trang phục, đến make up v&agrave; t&oacute;c. Chị Giang thậm ch&iacute; c&ograve;n đi c&ugrave;ng với stylist c&aacute; nh&acirc;n (điều m&agrave; m&igrave;nh bất ngờ nhất - wow, c&ograve;n chỉn chu hơn cả Linh khi mới bước v&agrave;o ng&agrave;nh thời trang). Dino th&igrave; cũng được style bởi stylist của Đẹp Magazine - Chị Chi Lemon.</p>\r\n<p>Linh đ&aacute;nh gi&aacute; đ&acirc;y l&agrave; lần xuất hiện đẹp, chỉn chu v&agrave; thời trang nhất của 2 người. T&ocirc;i chắc chắn rằng rất nhiều người phải đồng &yacute; với t&ocirc;i về điều n&agrave;y. Chia sẻ th&ecirc;m cho mọi người biết rằng, ch&iacute;nh manager khu vực Đ&ocirc;ng Nam &Aacute; của nh&atilde;n h&agrave;ng, đ&atilde; hỏi v&agrave;i người xung quanh về Dino v&agrave; đ&atilde; khen Dino rất nhiều. B&agrave; n&oacute;i rằng kh&ocirc;ng thể tin đ&acirc;y l&agrave; một food blogger v&igrave; Dino tr&ocirc;ng qu&aacute; .. đẹp trai v&agrave; ăn mặc như một t&agrave;i tử điện ảnh (Nguy&ecirc;n văn l&agrave; \"I cant believe he is a food blogger! He&rsquo;s so handsome, and he dressed like a Hongkong movie star\")</p>\r\n<p>Thật buồn, v&agrave; cũng buồn cười trong khi ch&iacute;nh những người l&agrave;m việc trong ng&agrave;nh thời trang c&ocirc;ng nhận những nỗ lực của c&aacute;c youtuber Việt Nam trong một sự kiện thời trang th&igrave; những anh h&ugrave;ng b&agrave;n ph&iacute;m ngồi nh&agrave; xem ảnh lại bu&ocirc;ng những lời gi&egrave;m pha đầy ti&ecirc;u cực tr&ecirc;n một group thời trang c&oacute; rất nhiều bạn trẻ theo d&otilde;i.</p>\r\n<p>Kh&ocirc;ng b&agrave;n đến chuyện xấu đẹp v&igrave; mỗi người một con mắt, cũng kh&ocirc;ng so s&aacute;nh với những fashionista hay những icon về thời trang, bởi v&igrave; điều đ&oacute; l&agrave; kh&ocirc;ng- c&ocirc;ng- bằng, nhưng Linh đ&aacute;nh gi&aacute; rất cao những nỗ lực như thế n&agrave;y. N&oacute; chứng tỏ sự t&ocirc;n trọng brand, cũng như t&ocirc;n trọng với c&ocirc;ng việc cũng như bản th&acirc;n họ. N&oacute; cũng chứng tỏ sự linh hoạt của những influencer thế hệ hiện tại, khi họ c&oacute; thể thay đổi để ph&ugrave; hợp với những y&ecirc;u cầu của c&ocirc;ng việc hay sự kiện.</p>\r\n<p>Linh viết những điều n&agrave;y kh&ocirc;ng phải để khoe rằng \"tụi t&ocirc;i mặc đẹp, tụi t&ocirc;i thời trang\", m&agrave; Linh muốn mọi người hiểu c&ocirc;ng việc của ch&uacute;ng t&ocirc;i l&agrave; g&igrave;. L&agrave; những người miệt m&agrave;i b&ecirc;n chiếc m&aacute;y quay, thức khuya b&ecirc;n b&agrave;n l&agrave;m việc để dựng video để sản xuất nội dung, nhưng vẫn lu&ocirc;n cố gắng hết sức để ho&agrave;n th&agrave;nh c&ocirc;ng việc tốt nhất trong mọi ho&agrave;n cảnh. Bởi v&igrave; ch&uacute;ng t&ocirc;i y&ecirc;u v&agrave; t&ocirc;n trọng nghề Youtuber, v&igrave; ch&uacute;ng t&ocirc;i tin rằng ch&uacute;ng t&ocirc;i đang truyền những sự thay đổi nhỏ b&eacute; nhưng t&iacute;ch cực tới những người đang xem video của ch&uacute;ng t&ocirc;i qua những m&agrave;n h&igrave;nh điện thoại hay laptop.</p>\r\n<p>Chuyện đ&aacute;nh gi&aacute; xấu-đẹp t&ocirc;i kh&ocirc;ng b&agrave;n đến. Nhưng việc một fanpage về thời trang , c&oacute; kh&aacute; nhiều b&agrave;i viết chuy&ecirc;n s&acirc;u về thời trang, c&oacute; sự ảnh hưởng trong giới trẻ lại đưa lời lẽ d&egrave; bỉu, miệt thị đến những người l&agrave;m nghề nghi&ecirc;m t&uacute;c như anh Dino, chị Giang Ơi v&agrave; rất nhiều người kh&aacute;c l&agrave; cực k&igrave; thiếu văn minh v&agrave; thiếu t&iacute;nh đ&oacute;ng g&oacute;p, tạo ra một văn ho&aacute; mỉa mai, ch&ecirc; b&ocirc;i thiếu t&iacute;ch cực.</p>\r\n<p>Đ&acirc;y kh&ocirc;ng g&igrave; kh&aacute;c ngo&agrave;i h&agrave;nh động cyberbullying- nạn bắt nạt tr&ecirc;n mạng x&atilde; hội đang phổ biến hiện nay. L&agrave; một cộng đồng trẻ v&agrave; văn minh, đ&aacute;ng lẽ họ n&ecirc;n truyền đi những th&ocirc;ng điệp t&iacute;ch cực, mang t&iacute;nh x&acirc;y dựng hơn l&agrave; những điều độc hại như thế n&agrave;y. Thật đ&aacute;ng buồn!</p>\r\n<p>Ng&agrave;y h&ocirc;m nay, sự tức giận của t&ocirc;i đến từ sự bất b&igrave;nh với những lời lẽ kh&ocirc;ng c&ocirc;ng bằng với những người bạn của t&ocirc;i, với nghề nghiệp của t&ocirc;i. T&ocirc;i biết rằng rất nhiều người lựa chọn im lặng trước những lời bắt nạt, miệt thị của fanpage n&agrave;y v&igrave; cũng kh&ocirc;ng muốn promote cho một fanpage với những lời lẽ chanh chua v&agrave; miệt thị, nhưng t&ocirc;i lựa chọn l&ecirc;n tiếng.</p>\r\n<p>C&aacute;m ơn tất cả mọi người đ&atilde; đọc!</p>\r\n<p>#STOPCYBERBULLYING</p>\r\n</div>\r\n</div>', '', '', 'Dino Vũ sau khi bị chê ăn mặc như \"cậu bé đi Đầm Sen nư', 'Dino Vũ sau khi bị chê ăn mặc như \"cậu bé đi Đầm Sen nước\": Thấy buồn và tổn thương, sẽ cân nhắc kỹ khi tham gia event thời trang sau này', ' f df df '),
(19, 'en', 'f-v-f-d-f-bdf', 'f v f d f bdf', '', '<p>&nbsp;cv sv a s dv s</p>', '', '', 'v vs a djfsdfbj', 'v  sdv  vkc ;vj ư', 'jv ;sd jv;kcjbv;ư'),
(20, 'vi', 'cong-chua-bang-gia-cua-lang-thoi-trang-viet-don-tim-voi-ve-dep-sieu-ngot-ngao', '“Công chúa băng giá” của làng thời trang Việt đốn tim với vẻ đẹp siêu ngọt ngào', '', '<div class=\"text_exposed_show\">\r\n<h2 class=\"knc-sapo\">Mẫu nh&iacute; Anh Thư &ndash; n&agrave;ng c&ocirc;ng ch&uacute;a băng gi&aacute; của l&agrave;ng mốt Việt vừa tung bộ ảnh khoe vẻ đẹp ki&ecirc;u kỳ trong Tuần lễ Thời trang Trẻ em Việt Nam m&ugrave;a 10 vừa diễn ra tại Khu du lịch sinh th&aacute;i điện ảnh Smiley Ville (H&agrave; Nội).</h2>\r\n<div class=\"VCSortableInPreviewMode active big-image-detail\" type=\"Photo\">\r\n<div><a href=\"https://channel.mediacdn.vn/2019/11/12/photo-1-15735388943222062608939.jpg\" data-fancybox-group=\"img-lightbox\" title=\"Anh Thư l&agrave; c&aacute;i t&ecirc;n mẫu nh&iacute; s&aacute;ng gi&aacute; của thời trang Việt khi l&agrave; một trong những mẫu nh&iacute; Việt Nam đầu ti&ecirc;n được sải bước tr&ecirc;n s&agrave;n diễn thời trang quốc tế tại Tuần lễ Thời trang Thượng Hải.\" target=\"_blank\" class=\"detail-img-lightbox\" rel=\"noopener noreferrer\"><img src=\"https://channel.mediacdn.vn/2019/11/12/photo-1-15735388943222062608939.jpg\" id=\"img_d124edf0-0512-11ea-9ff2-e5d2cef2ed0c\" w=\"811\" h=\"1216\" alt=\"&ldquo;C&ocirc;ng ch&uacute;a băng gi&aacute;&rdquo; của l&agrave;ng thời trang Việt đốn tim với vẻ đẹp si&ecirc;u ngọt ng&agrave;o - Ảnh 1.\" title=\"&ldquo;C&ocirc;ng ch&uacute;a băng gi&aacute;&rdquo; của l&agrave;ng thời trang Việt đốn tim với vẻ đẹp si&ecirc;u ngọt ng&agrave;o - Ảnh 1.\" rel=\"lightbox\" photoid=\"d124edf0-0512-11ea-9ff2-e5d2cef2ed0c\" type=\"photo\" data-original=\"https://channel.mediacdn.vn/2019/11/12/photo-1-15735388943222062608939.jpg\" width=\"\" height=\"\" class=\"lightbox-content\"></a></div>\r\n<div class=\"PhotoCMS_Caption\">\r\n<p data-placeholder=\"[nhập ch&uacute; th&iacute;ch]\">Anh Thư l&agrave; c&aacute;i t&ecirc;n mẫu nh&iacute; s&aacute;ng gi&aacute; của thời trang Việt khi l&agrave; một trong những mẫu nh&iacute; Việt Nam đầu ti&ecirc;n được sải bước tr&ecirc;n s&agrave;n diễn thời trang quốc tế tại Tuần lễ Thời trang Thượng Hải.</p>\r\n</div>\r\n</div>\r\n<div class=\"VCSortableInPreviewMode big-image-detail\" type=\"Photo\">\r\n<div><a href=\"https://channel.mediacdn.vn/2019/11/12/photo-1-1573538900004185148333.jpg\" data-fancybox-group=\"img-lightbox\" title=\"Anh Thư được nhiều nh&atilde;n h&agrave;ng thời trang tin tưởng lựa chọn cho c&aacute;c show diễn, c&aacute;c buổi photoshoot bởi kĩ năng catwalk v&agrave; bản lĩnh s&acirc;n khấu chuy&ecirc;n nghiệp, được thừa hưởng từ người thầy l&agrave; si&ecirc;u mẫu Xu&acirc;n Lan.\" target=\"_blank\" class=\"detail-img-lightbox\" rel=\"noopener noreferrer\"><img src=\"https://channel.mediacdn.vn/2019/11/12/photo-1-1573538900004185148333.jpg\" id=\"img_d67df2b0-0512-11ea-8a2f-5b2270cd9291\" w=\"2000\" h=\"3000\" alt=\"&ldquo;C&ocirc;ng ch&uacute;a băng gi&aacute;&rdquo; của l&agrave;ng thời trang Việt đốn tim với vẻ đẹp si&ecirc;u ngọt ng&agrave;o - Ảnh 2.\" title=\"&ldquo;C&ocirc;ng ch&uacute;a băng gi&aacute;&rdquo; của l&agrave;ng thời trang Việt đốn tim với vẻ đẹp si&ecirc;u ngọt ng&agrave;o - Ảnh 2.\" rel=\"lightbox\" photoid=\"d67df2b0-0512-11ea-8a2f-5b2270cd9291\" type=\"photo\" data-original=\"https://channel.mediacdn.vn/2019/11/12/photo-1-1573538900004185148333.jpg\" width=\"\" height=\"\" class=\"lightbox-content\"></a></div>\r\n<div class=\"PhotoCMS_Caption\">\r\n<p data-placeholder=\"[nhập ch&uacute; th&iacute;ch]\">Anh Thư được nhiều nh&atilde;n h&agrave;ng thời trang tin tưởng lựa chọn cho c&aacute;c show diễn, c&aacute;c buổi photoshoot bởi kĩ năng catwalk v&agrave; bản lĩnh s&acirc;n khấu chuy&ecirc;n nghiệp, được thừa hưởng từ người thầy l&agrave; si&ecirc;u mẫu Xu&acirc;n Lan.</p>\r\n</div>\r\n</div>\r\n<div class=\"VCSortableInPreviewMode big-image-detail\" type=\"Photo\">\r\n<div><a href=\"https://channel.mediacdn.vn/2019/11/12/photo-2-15735389000111261569950.jpg\" data-fancybox-group=